import React, { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";
import axios from "axios";
import PopupModal from "./PopupModal";
import { Spin } from "antd";

function Home() {
  const [dataDoctor, setDataDoctor] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);
  useEffect(() => {
    axios({
      headers: {
        "content-type": "application/x-www-form-urlencoded",
        Token: `Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySUQiOiI2MzVkMzMyYTgxYjcxNGFlYmIwMTA2OTEiLCJpYXQiOjE2Nzc3NjE0NzksImV4cCI6MTY4ODEyOTQ3OX0.4uiGuxphEwVuvJR1SD3ac1AHr787MpAluo17TELg8YQ`,
      },
      method: "get",
      url: "https://alo-server.onrender.com/api/user/data/profile-doctor/get/all/profile",
    })
      .then((r) => {
        setDataDoctor(r.data.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <>
      <Spin className="spin" />;
      <PopupModal isModalOpen={isModalOpen} setIsModalOpen={setIsModalOpen} />
      <div className="home-container">
        <div className="home-content">
          <div className="home-bg">
            <div className="nav-profile">
              <ul style={{ justifyContent: "flex-end" }}>
                <li style={{ margin: "0 40px" }}>
                  <NavLink style={{ color: "#000" }} to="/home">
                    {" "}
                    Đặt lịch
                  </NavLink>
                </li>
                <li style={{ margin: "0 40px" }}>
                  <NavLink style={{ color: "#000" }} to="/profile">
                    {" "}
                    Thông tin
                  </NavLink>
                </li>
              </ul>
              <ul style={{ justifyContent: "flex-end" }}>
                <li>Xin chào:</li>
                <li>Nguyễn Văn A</li>
              </ul>
            </div>
            <div className="home-display"></div>
            <div className="home-items">
              <div>
                {dataDoctor &&
                  dataDoctor?.map((data) => {
                    return (
                      <div className="card-container" key={data._id}>
                        <div className="card-item">
                          <div className="card-detail">
                            <p>{data.position}</p>
                            <span>Chuyên khoa: {data.specialist}</span>
                            <h4>{data.fullName}</h4>
                            <span className="introduce-doctor">
                              {data.introduce}
                            </span>
                            <div className="button-card-doctor">
                              {/* <button>Xem chi tiết</button> */}
                              <button
                                onClick={() => {
                                  setIsModalOpen(true);
                                }}
                              >
                                Đặt lịch
                              </button>
                            </div>
                          </div>
                          <div className="card-img">
                            <img src={data.img}></img>
                          </div>
                        </div>
                      </div>
                    );
                  })}
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
